import React, { useState, useEffect } from 'react';
import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiText, VuiSpacer } from '../../ui';
import './harvardManagementDocuments.scss';
import { useSearchContext } from '../../contexts/SearchContext';

// Define document type
interface Document {
  id: string;
  title: string;
  date: string;
  type: string;
}

// Sample documents
const DOCUMENTS: Document[] = [
  // Student Services & Support
  {
    id: "clubs-2024",
    title: "Student Life and Campus Clubs Guide",
    date: "2024-03-25",
    type: "Student Services"
  },
  {
    id: "military-2024",
    title: "Military Student Services Information",
    date: "2024-03-25",
    type: "Student Services"
  },
  {
    id: "counseling-2024",
    title: "Student Counseling Services Overview",
    date: "2024-03-25",
    type: "Student Services"
  },
  {
    id: "tutoring-2024",
    title: "English Center Tutoring Resources",
    date: "2024-03-25",
    type: "Student Services"
  },
  {
    id: "career-2024",
    title: "Career Services Center Guide",
    date: "2024-03-25",
    type: "Student Services"
  },

  // Academic Information
  {
    id: "catalog-2024",
    title: "City College Catalog 2024-25 (Second Addenda)",
    date: "2024-03-25",
    type: "Academic Information"
  },
  {
    id: "programs-2024",
    title: "Academic Programs Directory",
    date: "2024-03-25",
    type: "Academic Information"
  },
  {
    id: "transfer-2024",
    title: "Transfer Resources Guide",
    date: "2024-03-25",
    type: "Academic Information"
  },
  {
    id: "pcas-2024",
    title: "Professional College Advisory Session Guide",
    date: "2024-03-25",
    type: "Academic Information"
  },

  // Financial Aid & Costs
  {
    id: "scholarships-2024",
    title: "Scholarship Opportunities Guide",
    date: "2024-03-25",
    type: "Financial Aid"
  },
  {
    id: "aid-calendar-2024",
    title: "Financial Aid Calendar 2024-25",
    date: "2024-03-25",
    type: "Financial Aid"
  },
  {
    id: "ecmc-2024",
    title: "ECMC Financial Resources Guide",
    date: "2024-03-25",
    type: "Financial Aid"
  },
  {
    id: "loans-2024",
    title: "Student Loans Information",
    date: "2024-03-25",
    type: "Financial Aid"
  },
  {
    id: "costs-2024",
    title: "Cost of Attendance Guide",
    date: "2024-03-25",
    type: "Financial Aid"
  },
  {
    id: "aid-faq-2024",
    title: "Financial Aid FAQ",
    date: "2024-03-25",
    type: "Financial Aid"
  },

  // Admissions & Enrollment
  {
    id: "enrollment-steps-2024",
    title: "Steps to Enrollment Guide",
    date: "2024-03-25",
    type: "Enrollment"
  }
];

export const HarvardManagementDocuments: React.FC = () => {
  const { onSearch } = useSearchContext();
  const [documents, setDocuments] = useState<Document[]>(DOCUMENTS);
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedType, setSelectedType] = useState<string>('');

  const documentTypes = Array.from(new Set(DOCUMENTS.map(doc => doc.type))).sort();

  const filteredDocuments = documents.filter(doc => {
    const matchesSearch = doc.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         doc.type.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesType = !selectedType || doc.type === selectedType;
    return matchesSearch && matchesType;
  });

  const handleSearch = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSearchTerm(event.target.value);
  };

  const handleTypeSelect = (type: string) => {
    setSelectedType(type === selectedType ? '' : type);
  };

  return (
    <div className="documentsContainer">
      <div className="documentsContent">
        <VuiFlexContainer direction="column" spacing="l">
          <VuiFlexItem>
            <VuiTitle size="l">
              <h1>References</h1>
            </VuiTitle>
          </VuiFlexItem>

          <VuiFlexItem>
            <div className="searchContainer">
              <input
                type="text"
                placeholder="Search references..."
                value={searchTerm}
                onChange={handleSearch}
                className="searchInput"
              />
            </div>
          </VuiFlexItem>

          <VuiFlexItem>
            <div className="typeFilters">
              {documentTypes.map(type => (
                <button
                  key={type}
                  className={`typeFilter ${type === selectedType ? 'selected' : ''}`}
                  onClick={() => handleTypeSelect(type)}
                >
                  {type}
                </button>
              ))}
            </div>
          </VuiFlexItem>

          <VuiFlexItem>
            {filteredDocuments.length > 0 ? (
              <div className="documentsList">
                {filteredDocuments.map(doc => (
                  <div key={doc.id} className="documentItem">
                    <div className="documentInfo">
                      <h3>{doc.title}</h3>
                      <span className="documentType">{doc.type}</span>
                      <span className="documentDate">{doc.date}</span>
                    </div>
                  </div>
                ))}
              </div>
            ) : (
              <div className="noDocuments">
                <VuiText>
                  <p>No references found matching your criteria.</p>
                </VuiText>
              </div>
            )}
          </VuiFlexItem>
        </VuiFlexContainer>
      </div>
    </div>
  );
};
